"""
Given an integer array sorted in non-decreasing order, return an array of the squares of each number sorted in
non-decreasing order.
"""


def squares_sorted_array(arr: list) -> list:
    """
    This function takes as an input
    and returns

    Example:
        (1)
    """

    arr = [number ** 2 for number in arr]
    arr.sort()
    return arr


